import React from 'react';

function Careers() {
  return (
    <section id="careers" className="careers">
      <h2>Join Us</h2>
      <p>
        Inventra Labs is a hub of creativity and technology. Join our team and build the next big thing.
      </p>
      <button>View Open Positions</button>
    </section>
  );
}
